import React, { Component } from 'react'

const DailyTodos = (dailyTodos) =>{
    let test =  [
        {
          id: 1,
          title: 'Programme',
          daysChecked: 20,
          onDay: 25,
          totaldays: 30,
          thisWeek:[true, false, true, true, false, null, null]
        },
        {
          id: 2,
          title: 'Study React',
          daysChecked: 3,
          onDay: 7,
          totaldays: 30,
          thisWeek:[true, false, true, true, false, null, null]
        },
        {
          id: 3,
          title: 'Do Stuff',
          daysChecked: 20,
          onDay: 25,
          totaldays: 30,
          thisWeek:[false, false, false, false, false, null, null]
        }
      ]

    const displayTodos = test.map(todo =>{
        return(
        <div className="onedailygoal" >
            <div className="onedailygoalheading">
                <h4>Programming</h4>Write Code
                {console.log(todo.title)}
            </div>
        </div>
        )
    })
    return(
        <div className='test'>
            {displayTodos}
        </div>
    )
}
export default DailyTodos
